  return (
    <div className="border p-4 rounded-lg shadow-md">
      <h3 className="text-lg font-bold">{stay.name}</h3>
      <p>{stay.location}</p>
      <p>${stay.price} per night</p>
    </div>
  );
};

export default StayCard;
